webpackJsonp([78714097303556],{984:function(e,t){e.exports={data:{content:{content:"<h2 id=前言>前言</h2>\n<p>原本預約了兩點面試的，結果我一點多就去到，面試官讓我在一旁坐坐。感覺這次面試氣氛不錯，但是不知道為什麼每次面試，大多時間都是問Database的問題。。。</p>\n<h2 id=面試問題：>面試問題：</h2>\n<h3 id=背景>背景</h3>\n<ol>\n<li>請自我介紹</li>\n<li>為什麼會從前端開始？</li>\n<li>請畫出現在項目的技術圖，並簡單介紹一下</li>\n<li>你最近在探索什麼新技術？</li>\n</ol>\n<h3 id=技術>技術</h3>\n<ol>\n<li>NoSQL和SQL的比較，優點和缺點？</li>\n<li>哪一個性能比較好？</li>\n<li>HTTPS如何加密</li>\n</ol>\n<h2 id=行動>行動</h2>\n<p>Learning by Coding，動手做項目學習吧。</p>\n",title:"某一次面試後記",createdDate:"2017-03-27T20:00+08:00",headerImgur:null,id:"6cI6fXzSk8K6Eu8sCKiI0q",toc:["前言","面試問題：","背景","技術","行動"],tags:"Interview"},latestPosts:{totalCount:60,edges:[{node:{title:"【網易考拉校招】部門總監面對面-直播答疑邀約（附網易內推碼B222E54）",url:"netease-kaola-live",createdDate:"2018-08-01T20:00+08:00"}},{node:{title:"Uncaught ReferenceError: regeneratorRuntime is not defined 解決方法",url:"regenerator-runtime-is-not-defined",createdDate:"2018-07-29T20:00+08:00"}},{node:{title:"關於作者",url:"about-calpa-liu",createdDate:"2018-05-01T20:00+08:00"}},{node:{title:"【方法】在直接複製貼上內容的時候，可能已經不知不覺注入了一段不可視的「空白」",url:"insert-zero-width-characters",createdDate:"2018-04-06T23:00+08:00"}},{node:{title:"知乎無限 live 數據流網站",url:"zhihu-unlimited-lives-website",createdDate:"2018-03-28T20:49+08:00"}},{node:{title:"Gatsbyjs async/await 更新報錯解決方法",url:"gatsybjs-async-await-upgrade-bug-solution",createdDate:"2018-03-21T20:00+08:00"}}]}},pathContext:{id:"6cI6fXzSk8K6Eu8sCKiI0q"}}}});
